import {get, del, post, put, upload} from "./HttpService";
import endpoints from "../config/endpoints";
import moment from "moment";

const test = {
  data:{
    items: [
      {name: 'Push up', duration: 34, level: 'Basic', createdAt: moment(new Date()).subtract(2, "days").toDate().getTime(),status:'Active'},
      {name: 'Close push up', duration: 53, level: 'Basic', createdAt: moment(new Date()).subtract(2, "days").toDate().getTime(),status:'Active'},
      {name: 'Side Planks', duration: 80, level: 'Basic', createdAt: moment(new Date()).subtract(2, "days").toDate().getTime(),status:'Active'},
    ]
  }
}

export default class ExerciseService {
  static searchExercise(dataSearch = {nextToken: "", limit: 10, query: {}}) {
    return get(endpoints.exerciseManagement.list, dataSearch).then(value => {
      return value ? value.data : null;
    });
  }

  static removeExercise(id) {
    return del(endpoints.exerciseManagement.delete.replace(":ID", id)).then(value => {
      return value ? value.data : null;
    });
  }

  static updateExercise(id, exercise) {
    return put(endpoints.exerciseManagement.update.replace(":ID", id), exercise).then(value => {
      return value ? value.data : null;
    });
  }

  static getExercise(id) {
    return get(endpoints.exerciseManagement.update.replace(":ID", id)).then(value => {
      return value ? value.data : null;
    });
  }

  static createExercise(exercise) {
    return post(endpoints.exerciseManagement.create, exercise).then(value => {
      return value ? value.data : null;
    });
  }

  static listUserInExercise(exerciseId, group, params) {
    return get(endpoints.exerciseManagement.listUser.replace(":ID", exerciseId), {...params, group}).then(value => {
      return value ? value.data : null;
    });
  }

  static addUserToExercise(exerciseId, username) {
    return put(endpoints.exerciseManagement.addUser.replace(":ID", exerciseId), {user: username}).then(value => {
      return value ? value.data : null;
    });
  }

  static uploadLogoExercise(file) {
    var formdata = new FormData();
    formdata.append("file", file);
    return upload(endpoints.exerciseManagement.upload, formdata).then(value => {
      return value ? value.data : null;
    });
  }

  static uploadVideoExercise(file) {
    var formdata = new FormData();
    formdata.append("file", file);
    return upload(endpoints.exerciseManagement.uploadVideo, formdata).then(value => {
      return value ? value.data : null;
    });
  }

  static removeUserFromExercise(exerciseId, username) {
    return put(endpoints.exerciseManagement.removeUser.replace(":ID", exerciseId), {user: username}).then(value => {
      return value ? value.data : null;
    });
  }
}
